SELECT ?result WHERE {
  # Step 1: Find Archduchess Margarete Sophie's parent
  ?parent a dbo:Person ;
          dbo:child <http://dbpedia.org/resource/Archduchess_Margarete_Sophie_of_Austria> .

  # Step 2: Find the child of that parent who is royalty
  ?royaltyChild a dbo:Royalty ;
                dbo:parent ?parent .

  # Step 3: Identify Philipp Albrecht's child
  ?philippChild dbo:child <http://dbpedia.org/resource/Philipp_Albrecht,_Duke_of_W%C3%BCrttemberg> .

  # Step 4: Trace back to Alexander of Württemberg through three generations
  ?grandparent a dbo:Person ;
               dbo:child ?philippChild .
  ?greatGrandparent a dbo:Person ;
                    dbo:child ?grandparent .
  ?ancestor a dbo:Person ;
            dbo:child ?greatGrandparent ;
            foaf:name "Alexander of Württemberg"@en .

  # Step 5: Find the predecessor of this child
  ?predecessor dbo:succ ?philippChild .

  # Final step: Get the child of the royalty identified in Step 2
  ?result dbo:child ?royaltyChild .
}
```

