    <http://dbpedia.org/resource/Yurii_Khmelnytsky> <http://dbpedia.org/ontology/successor> ?successor .
  }
  OPTIONAL {
    ?entity <http://dbpedia.org/ontology/reference> ?reference .
    FILTER(CONTAINS(LCASE(?reference), "george ducas"))
  }
}

SELECT ?result WHERE {
  # Wars involving Konstantinos Ventiris
  OPTIONAL { <http://dbpedia.org/resource/Konstantinos_Ventiris> <http://dbpedia.org/ontology/battle> ?result . }

  # Wars led by the leader of the National Party of Greece
  OPTIONAL {
    ?leader <http://dbpedia.org/property/leaderParty> <http://dbpedia.org/resource/National_Party_of_Greece> .
    ?leader <http://dbpedia.org/ontology/battle> ?result .
  }

  # Entities in Athens
  OPTIONAL { ?entity <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Athens> . }
}

