SELECT DISTINCT ?result WHERE {
  { 
    ?child <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Allan_Arbus> .
    ?child <http://dbpedia.org/ontology/familyName> ?parent .
    BIND(?parent AS ?result)
  }
  UNION
  {
    ?person <http://dbpedia.org/property/occupation> "Photographer"@en .
    ?person <http://dbpedia.org/ontology/birthParent> ?result .
  }
}

SELECT ?parent WHERE {
    # Find children of Frederick Stanley, 16th Earl of Derby
    ?child <http://dbpedia.org/ontology/father> ?fsderby .
    ?fsderby rdfs:label "Frederick Stanley, 16th Earl of Derby"@en .

    # Find parents of awardees of Commander of the Royal Victorian Order
    ?awardee <http://dbpedia.org/property/awards> ?award .
    ?award rdfs:label "Commander of the Royal Victorian Order"@en .
    ?awardee <http://dbpedia.org/ontology/father|<http://dbpedia.org/ontology/mother> ?parent .

    # Find common parents
    VALUES ?child { ?child }
    VALUES ?awardee { ?awardee }

    FILTER (?child = ?awardee)
}

SELECT ?grandchild WHERE {
  ?parent <http://dbpedia.org/ontology/spouse> ?archduchess .
  ?archduchess rdfs:label "Margarete Sophie of Austria"@en .

  ?royalChild <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Royalty> ;
              <http://dbpedia.org/ontology/birthParent> ?parent .

  ?grandchild <http://dbpedia.org/ontology/birthParent> ?royalChild .
}

SELECT ?successor WHERE {
  ?pac <http://dbpedia.org/ontology/commander> ?force .
  ?force <http://www.w3.org/2000/01/rdf-schema#label> "Great Turkish War"@en .
  ?pac <http://dbpedia.org/property/successor> ?successor .
  ?successor <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Politician> .
  ?successor <http://dbpedia.org/ontology/officeHolder> ?office .
  OPTIONAL { ?successor <http://dbpedia.org/property/reference> <http://dbpedia.org/resource/George_Ducas> . }
  FILTER(?pac = <http://dbpedia.org/resource/Micha%C5%82_Kazimierz_Pac>)
}

SELECT ?result WHERE {
  ?sinha <http://dbpedia.org/property/occupation> ?profession .
  ?grant <http://dbpedia.org/ontology/starring> ?work .
  ?work <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> ?type .
  FILTER(?type IN (<http://dbpedia.org/ontology/Film>, <http://dbpedia.org/ontology/TVEpisode>)).
  ?actor <http://dbpedia.org/ontology/starring> ?work .
  ?sinha <http://dbpedia.org/property/starring> ?work .
  ?actor <http://dbpedia.org/property/occupation> ?result .
}
WHERE {
  VALUES ?sinha { <http://dbpedia.org/resource/Shatrughan_Sinha> }
  VALUES ?grant { <http://dbpedia.org/resource/Richard_E._Grant> }
}

