  FILTER (str(?elvira) = "Elvira of Castile, Queen of Sicily"^^<http://www.w3.org/2001/XMLSchema#string>)

  ?child <http://dbpedia.org/ontology/nationality> ?nationality .
  FILTER EXISTS { ?nationality <http://dbpedia.org/property/type> "Royalty"@en }

  ?reference <http://dbpedia.org/ontology/reference> ?child .
  ?reference <http://dbpedia.org/ontology/nationality> ?refNationality .
  FILTER EXISTS { ?refNationality <http://dbpedia.org/property/type> "Royalty"@en }
  FILTER EXISTS { ?reference <http://dbpedia.org/ontology/officeHolder> ?office }

  ?william <http://dbpedia.org/ontology/father> ?reference .
  FILTER (str(?william) = "William I"^^<http://www.w3.org/2001/XMLSchema#string>)
}
```

