SELECT DISTINCT ?associatedArtist ?bandMember WHERE {
    # Part 1: Find associated musical artist of Stuart Tosh
    <http://dbpedia.org/resource/Stuart_Tosh> <http://dbpedia.org/ontology/associatedMusicalArtist> ?associatedArtist .

