SELECT ?associatedArtist WHERE {
  ?person <http://dbpedia.org/property/birthName> "Nicholas Michael Curran"@en .
  ?person <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/MusicalArtist> .

  ?person <http://dbpedia.org/ontology/associatedMusicalArtist> ?associatedArtist .

  OPTIONAL {
    ?reference <http://dbpedia.org/ontology/reference> <http://dbpedia.org/resource/The_Fabulous_Thunderbirds> .
    ?associatedArtist <http://dbpedia.org/ontology/reference> ?reference .
  }

  OPTIONAL {
    ?bandMember <http://dbpedia.org/property/memberOf> ?band .
    ?band <http://dbpedia.org/ontology/bandMember> ?person .

    ?ericClapton <http://dbpedia.org/property/memberOf> ?claptonBand .
    ?claptonBand <http://dbpedia.org/ontology/bandMember> ?bandMember .
  }
}

