SELECT ?force1 ?commander ?force2 WHERE {
  # Military force in Battle of Fort Royal
  <http://dbpedia.org/resource/Battle_of_Fort_Royal> dbpedia-owl:participatedIn ?force1 .

  # Commander in French campaign in Egypt and Syria
  <http://dbpedia.org/resource/French_campaign_in_Egypt_and_Syria> dbpedia-owl:commander ?commander .

  # Military force associated with an event involving Robert Calder
  ?event a dbo:Event ;
         dbo:agent <http://dbpedia.org/resource/Robert_Calder> .
  ?event dbpedia-owl:militaryForce ?force2 .
}

