  ?work1 a <http://dbpedia.org/ontology/Book> ;
         a <http://dbpedia.org/ontology/WrittenWork> .

  ?work2 <http://dbpedia.org/property/author> ?hillaryClinton .
  ?hillaryClinton foaf:name "Hillary Clinton"@en ;
                  a <http://dbpedia.org/ontology/Politician> ;
                  a <http://dbpedia.org/ontology/OfficeHolder> .
  ?work2 a <http://dbpedia.org/ontology/Book> ;
         a <http://dbpedia.org/ontology/WrittenWork> .

  ?hillaryClinton foaf:mbox ?spouseEmail .
  ?spouseEmail foaf:maker ?spouse .
}

